import React from "react";

let facultyData = [
    {
        profile: "profilepic",
        name: "Indira Bidari",
        designation: "Assistant Professor",
        department: "Computer Science And Engineering",
        email: "indirabidari@kletech.ac.in"
    }
]

let name = facultyData[0].name
let designation = facultyData[0].designation
let department = facultyData[0].department
let email = facultyData[0].email



function profileDiv(){
    return <div>
        Name = {name}
        <br />
        Designation = {designation}
        <br />
        Department = {department}
        <br />
        Email = {email}
    </div>
}


function About(){
    return <div style={{textAlign: "center"}}>
        <div className="py-20">
            This is a about 
        </div> 
        {profileDiv()}
    </div>
}

export default About;
